INSERT INTO `about_us` (`about_us_id`, `image`, `title`, `content`, `status`, `created`, `modify`) VALUES
(1, 'about-spa.png', 'About Our Spa', '<p>Spa Company is one of the best and leading companies in India known for delivering the quality services. It gives the unique experience to the clients by our special treatment and massage therapies. Spa experts of our company have designed natural treatments where you will come across with different herbal and ancient techniques, which gives the best mode in the field of relaxation. Our Spa experts are trained and professionals who provide customized services according to the customers need. These experts are friendlier in nature and solve the problem of the clients in an effective way.<br /><br />By offering standardized services, our company has designed individual shower room where you can your own time in case of bathing and steaming. Even the outfits provided by us during spa treatments are disposable in nature which cannot be used again for further Spa treatment. We are best in maintaining the hygiene part where clients will not face any kind of problem in cleanliness part. We maintain the privacy part of the customers and will not disclose any kind of information without taking the clients permission.</p>', 1, '2018-05-31', NULL);
