(1, 'Tattva Spa -Gurgaon', 'We invite you to escape from your urbanised environs to an oasis of rejuvenation and harmony at the award winning, Tattva Spa. Choose from an array of professional spa and beauty therapies. We look forward to serving you during your stay in Gurgaon. Services, Treatments & Amenities: Rejuvenating Massages | Ayurvedic treatments | Body scrub | Facials | Salon (opening soon)', NULL, 'Sector Road | Plot no B, 27, Block B, Sushant Lok Phase I, Sector 27, Gurugram (Gurgaon) 122002, Ind', NULL, NULL, '+91 124 488 8236', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, 'Sector Road | Plot no B, 27, Block B, Sushant Lok Phase I, Sector 27, Gurugram (Gurgaon) 122002, India', 'b-2.jpg', 'Tattva Spa -Gurgaon in Sushant Lok Phase I, Delhi', 'Tattva Spa -Gurgaon in Sushant Lok Phase I, Delhi', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'pu', 'pp'),
(2, 'The Leela’s Spa Lavanya', 'Not Provide', NULL, 'The Leela Kempinski Hotel, Gurugram (Gurgaon), India', NULL, NULL, '+91 124 477 1234', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, 'The Leela Kempinski Hotel, Gurugram (Gurgaon), India', 'b-2.jpg', NULL, 'Nill', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'f', 'f'),
(3, 'Azaaya Spa and Salon', 'Welcome to Azaaya Spa!Azaaya, a boutique health spa provides a place of inspiration and discovery.Discover your natural balance with holistic health therapies and luxurious spa experiences.With a focus on releasing toxins that affect our health and longevity and embracing centuries of natural healing wisdom, we aim to bring you physical, mental, emotional and spiritual balance.The architecture of our intimate spa draws upon Thai inspiration, to blend seamlessly with the beauty of contemporary feel.Offering traditional Thai massages, western massages, spa facials and professional salon services.', NULL, 'Opposite Ibis Hotel D L F Golf Course Road D L F Golf Course Road, Gurugram (Gurgaon) 122002, India', NULL, NULL, '+91 124 647 0355', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, 'Opposite Ibis Hotel D L F Golf Course Road D L F Golf Course Road, Gurugram (Gurgaon) 122002, India', 'b-2.jpg', NULL, 'Nill', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'f', 'f'),
(4, 'Ayurveda Kendra', 'Ayurveda Kendra(est.1990) is considered as the most Authentic Ayurvedic experience in Delhi. It is famous for its Ayurvedic treatments and therapies that are famous all around the world, as it boasts of clients from every habitable continent on earth. The wide range of treatments include detoxification by Panchakarma, rejuvenation therapies for promoting vitality, anti aging and age reversal therapies, weight loss and beauty treatment therapies and treatments to overcome depressions and stress. Besides Ayurvedic massages, oral medicines are also given wherever required.', NULL, '1601 DLF City | Phase-IV, Near Galleria Market, Behind Cross Point Mall, Gurugram (Gurgaon) 122002, ', NULL, NULL, '+91 124 404 6218', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, '1601 DLF City | Phase-IV, Near Galleria Market, Behind Cross Point Mall, Gurugram (Gurgaon) 122002, India', 'b-2.jpg', NULL, 'Nill', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'f', 'f'),
