(6, 'Senses Spa', 'Set amidst a tranquil and peaceful environment, The Senses Spa at Le Meridien Gurgaon, offers a wide array of traditional and modern treatments and packages carefully put together by a team of experts. The 5 temperature controlled treatment rooms are tastefully designed with separate steam and shower areas.', NULL, 'Sector 26 M G Road | Le Meridien Gurgaon, Gurugram (Gurgaon) 122002, India', 'Rakesh Thakur', NULL, '+91 88606 09395', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, 'Sector 26 M G Road | Le Meridien Gurgaon, Gurugram (Gurgaon) 122002, India', 'b-2.jpg', 'Senses The Spa in Gurgaon Sector 7, Delhi', 'Senses The Spa in Gurgaon Sector 7, Delhi', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'f', 'f'),
(7, 'Monsoon Salon & Spa', 'Monsoon Salon & Spa at Ambience Mall Gurgaon is located on the second floor of this plush mall. This is a flagship location covering 4200 square feet. The interior of the Salon boasts of plush interiors with fully equipped beauty and spa rooms. This location is even more suitable for frequent female visitors as the salon is surrounded by several women’s fashion brands.', NULL, 'Nh - 8 National Highway 8 | S 202, 2nd floor, Ambience Mall, Gurugram (Gurgaon) 122002, India', NULL, NULL, '+91 124 466 5465', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, 'Nh - 8 National Highway 8 | S 202, 2nd floor, Ambience Mall, Gurugram (Gurgaon) 122002, India', 'b-2.jpg', NULL, 'Nill', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'f', 'f'),
