(10, 'Tuscany Spa', 'The Tuscany Experience was born in 2011, with the launch of the Tuscany Spa in South Delhi. In less than a year the company has evolved from a single branch to ten more in North India. Today, Tuscany Spas can be found in diverse locations and every experience is completely unique, because we honour the diversity of the culture we are immersed in.', NULL, '2773, C-1 Block | Sushant Lok-1, Gurugram (Gurgaon) 122002, India', 'Vikram', NULL, '+91 124 654 7231', NULL, 1, '2018-06-25 01:30:02', NULL, NULL, NULL, '2773, C-1 Block | Sushant Lok-1, Gurugram (Gurgaon) 122002, India', 'b-2.jpg', 'Tuscany Spa in DLF City Phase 4, Delhi', 'Tuscany Spa in DLF City Phase 4, Delhi', NULL, NULL, 2, 15, 6, 1126, 13, 101, 'f', 'f'),
