(38, 'Aura Spa', 'Aura Spa at The Park is the award winning luxury spa brand of The Park.\'Best new spa in India\'-Asia SPA 2011, \'Best spa interiors\'-Asia SPA 2011,2012. The design of Aura, The Park Hyderabad is based on Diamonds from the Golconda region, which is reflected through its organic shapes. Each therapy room is named after different stones found in the mines of Hyderabad For eg:The Great Mughal Diamond, Darya-i-noor Diamond.The wet area in the spa is adorned with two Amethyst steam rooms, which aid in maintaining a pure and positive atmosphere whilst detoxifying the body and strengthening immunity. “The Great Mughal Suite” which is a couple suite and the VIP suite - “Darya-i-noor” also feature chromo therapy whirlpools and heated massage beds. The unisex GYM equipped with technogym and a unisex SALON caters to beauty needs whilst restoring your body-mind-soul connection.The treatments at Aura, The Park Hyderabad, are based on the “panch – mahabuta” concept which harness the power of five elements of nature for holistic well being.Regional therapeutic touch is given to services using age old recipes amalgamated with the latest trends.To name a few are The Signature ritual–“Aura Awakening”, “Healing Hot Gem Massage” using heated gem stones, “The Nawabi Experience” incorporating traditional south Indian ingredients.', NULL, '22 Raj Bhawan Rd, Somajiguda | The Park Hotel, Hyderabad 500082, India', NULL, NULL, '+91 40 2345 6789', NULL, 1, '2018-06-25 12:40:02', NULL, NULL, NULL, '22 Raj Bhawan Rd, Somajiguda | The Park Hotel, Hyderabad 500082, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 0, 0, 0, 'f', 'f'),
