(41, 'Jawed Habib Spa Yoga', 'The Jawed Habib Spa Yoga marries the ancient practice of yoga with Ayurveda-inspired body therapies and treatments to give you a holistic experience. According to yoga, the human body has seven fundamental chakras or ‘life-force energy centres,’ better known as Chakras, which play a vital role in our emotional, mental and physical harmony and well-being. The Jawed Habib Spa Yoga houses seven distinct regions, each symbolic of a chakra. Here, clients can enjoy the benefits of yoga and meditation practices at our morning sessions, with an expert instructor. The size of the groups is small, which means that the instructors can give each client personalized attention.', NULL, 'Gachibowli Road | Second Floor, Fantasy Square, At Bio Diversity Signal,, Hyderabad 500081, India', NULL, NULL, '+91 88867 78080', NULL, 1, '2018-06-25 12:40:03', NULL, NULL, NULL, 'Gachibowli Road | Second Floor, Fantasy Square, At Bio Diversity Signal,, Hyderabad 500081, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 0, 0, 0, 'f', 'f'),
