(110, 'The Thai Spa - Alipore Enclave', 'Thailand, also known as the spa capital of Asia, has a rich history behind its spa culture. The founder of the Thai massage treatment is said to have been Shivago Komarpaj (Jivaka Komarabhacca), the Buddha\'s physician over 2,500 years ago. Drawing on its rich tradition of home-grown remedies and herbal knowledge, the country has tapped into these folk traditions to build a vibrant, modern spa industry. The Thai Spa , brings this very synthesis of healing traditions to India specializing in the Nuat Thai technique to help you indulge in some much-needed \"me-time\", to to shut off from external stimulation switch off and relax, recharge, detox and beautify. Other benefits include relief from ailments like asthma and migraines to sprains, bruises, and anxiety. Relief from physical and emotional tension, ameliorated sleep, improved flexibility, a greater awareness of body and mind, and a release of blocked energy are also some of the benefits The Thai Spa assures you. The Thai Spa, was the first of its kind in East India, dedicated in providing quality service to a cross-section of clients and introducing thai spa culture in this part of the country. The Thai Spa deserves special mention for being the only spa chain in this region to hire trained therapists directly from Thailand so that the spa experience is as authentic as it can get. Apart from Kolkata, Mumbai and Ahmedabad, Surat, the new Thai Spa in Siliguri, Amritsar, Bangalore, Pune, and Raipur has marked a challenging new milestone to our endeavour.', NULL, 'Alipore Road | Alipore Enclave 17/1F, 3rd Floor, Kolkata 700027, India', NULL, NULL, '+91 98365 88841', NULL, 1, '2018-06-25 01:06:58', NULL, NULL, NULL, 'Alipore Road | Alipore Enclave 17/1F, 3rd Floor, Kolkata 700027, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 0, 0, 0, 'f', 'f'),
(111, 'Evokes Spa', 'Evokes SPA inspires an individual to explore the inherent serenity and offers a refreshing SPA experience. The use of premium herbal oils and superior products redefines the way one feels about SPA therapies and body treatments. Evokes SPA builds a stimulating aura to provide calm serenity to the spirit, and the aromatic massages and therapies enliven the senses to experience serene harmony.', NULL, '197, Sarat Bose Rd | Lake Market, Kalighat, Kolkata 700039, India', NULL, NULL, '+91 90077 71207', NULL, 1, '2018-06-25 01:06:58', NULL, NULL, NULL, '197, Sarat Bose Rd | Lake Market, Kalighat, Kolkata 700039, India', 'b-2.jpg', 'Evokes Spa', 'Evokes Spa', NULL, NULL, 0, 0, 6, 5583, 41, 101, 'f', 'f'),
