(156, ' Relax Essence Float Spa', 'Come to heal Mind, Body and Soul. 500 kgs of epsom salt mixed water on which your body floats naturally. Experience Zero Gravity. Experience deep Meditative Trance. Calm your brain waves. Flush out toxins. Find the profound peace you have been missing out on. Good for back pain relief, anxiety relief, Stress relief . This therapy works wonders for sleep improvement . De-congest your emotions. Great for skin rejuvenation as Epsom salt contains a lot of magnesium and sulfur . The only two sounds you get to hear during the therapy are your heart beats and your breath. Come to find your inner being. Come to experience Theta brain waves. Come to meet the new You.', NULL, 'Balewadi Phata Baner Road | Paradise Apartments, opposite Dot Fitness Club, Pune 411038, India', NULL, NULL, '+91 96045 00999', NULL, 1, '2018-06-25 01:09:59', NULL, NULL, NULL, 'Balewadi Phata Baner Road | Paradise Apartments, opposite Dot Fitness Club, Pune 411038, India', 'b-2.jpg', 'Relax Essence Float Spa in Baner, Pune', 'Relax Essence Float Spa in Baner, Pune', NULL, NULL, 2, 15, 6, 2763, 0, 101, 'f', 'f'),
(157, 'The Four Fountains Spa', 'The Four Fountains Spa is India\'s first chain of affordable health spas. We offer spa therapies for de-stressing, de-toxification, immunity and beauty for men and women. Our therapies include more than 20 Indian and international massages, body polishes, body wraps and facials. Our spas are located in Mumbai, Pune, Aurangabad, Goa and Manali.', NULL, '1st Floor - Pradyumna, Lane next to Spencer\'s supermarket, Off Bhandarkar Road, Pune 411004, India', NULL, NULL, '+91 20 6400 1100', NULL, 1, '2018-06-25 01:09:59', NULL, NULL, NULL, '1st Floor - Pradyumna, Lane next to Spencer\'s supermarket, Off Bhandarkar Road, Pune 411004, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 2763, 0, 101, 'f', 'f'),
(158, 'Cologne Spa n Salon', 'Cologne attributes a lifestyle architecture to the spa experience.’Pause n Unwind’ puts into limelight the individual, one’s life and being, and his belonging. Cologne is the much awaited pause in a fast-paced playback. We believe in the need to unwind, the need to get back to oneself.Let your inner beauty come to life in the luxuriant pampering and pleasure where we offer a blend of unique therapies inspired by Western & Ayurvedic tradition, designed to release the fatigue of your journey & return to yourself.We are here to enliven your spirit and awaken your senses. Our day spa offers a balanced variety of treatments to address our guests’ physical, mental, emotional & energetic states with personalized full body relaxing, stress relieving, energetic massage therapies with a complimentary steam; Facials of all types of skin for Men & Women; Body ecstasy (polishing); Foot Relaxation therapies, Memberships, Packages & lots more...Away from hustle-bustle of busy roads and unlike regular spas Cologne gives you a feel of a European style with a huge open air green space in our patio. You can enjoy green tea after your treatment with the greenery around which will place your mind, body and soul in another world.Cologne also offers a spacious place for their valuable guests to get together to celebrate birthdays, kitty parties with the pampering foot relaxation therapies with a healing bite of Dr.Fish at the Foot Zone which leaves a unique pleasant tingling sensation.Give Cologne a chance to awaken your sixth sense.A space to simply be yourself ! :)', NULL, 'Lane No 6 | Koregaon Park, Pune 411001, India', NULL, NULL, '+91 95451 09116', NULL, 1, '2018-06-25 01:09:59', NULL, NULL, NULL, 'Lane No 6 | Koregaon Park, Pune 411001, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 0, 0, 0, 'f', 'f'),
