(217, 'O2 Spa ', 'O2SPA SURAT With high-stress lifestyles taking its toll, people are looking for ways to unwind and relax, and what could be more relaxing and refreshing than a day at a spa? We have one Luxurious spa in the Beautiful city of Surat', NULL, 'F.P.29 Rundh Village , Dumas Road | Virtuous Retail Surat, Surat 395007, India', 'Adnan', 'contact@o2spa.org', '+91 90300 13468', NULL, 1, '2018-06-25 01:11:24', NULL, NULL, NULL, 'F.P.29 Rundh Village , Dumas Road | Virtuous Retail Surat, Surat 395007, India', 'b-2.jpg', 'O2 Spa Salon Pvt Ltd in Magdalla, Surat', 'O2 Spa Salon Pvt Ltd in Magdalla, Surat', NULL, NULL, 0, 0, 6, 1041, 0, 101, 'f', 'f'),
(218, 'Reflexions', 'Reflexions Salon & Spa started in 2007 in the prime location of Parle Point, Surat.Mr. Amit Saraf, the man behind the venture is a self made man with a combination of his determination, effort and entrepreneurial acumen. He has successfully achieved many milestones. The year 2008 marked the entry of his wife Avani as a hairstylist & makeup artist with the salon. Avani, an artist by heart, honed her skills from the who\'s who of the industry in Mumbai, London & Hong Kong.In a short span of time this husband - wife duo have grown their business to manifolds. Over this period they have also developed an elite client base and are very well known for their high end quality services.Reflexions is the 1st and only salon in Gujarat to qualify for the Finals of L\'Oreal Professionnel Colour Trophy. Kérastase Paris, the French Luxury Hair Care, is now available at Reflexions Salon & Spa. Born in the luxury environment of Paris in 1964, Kérastase has been the worldwide leader in professional luxury hair care.', NULL, 'M-2-3 Manav Mandir | Parle Point, Surat 395007, India', NULL, NULL, '+91 261 225 5898', NULL, 1, '2018-06-25 01:11:24', NULL, NULL, NULL, 'M-2-3 Manav Mandir | Parle Point, Surat 395007, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 1041, 0, 101, 'f', 'f'),
(219, 'Kiara Wellness', 'Our sophisticated blends of natural spa products including massage oils, luxury facials, body scrubs,and wraps not only relaxes your senses but also rejuvenates and adds glow to your life. Blended eastern and western massage techniques helps restore vitality and inner peace. Multitude of massages, spa treatment and holistic therapies are offered.', NULL, '201 Shikar Complex | 2nd Floor Shikhar Complex, Parle Point, Surat 395007, India', NULL, NULL, '+91 97126 70248', NULL, 1, '2018-06-25 01:11:24', NULL, NULL, NULL, '201 Shikar Complex | 2nd Floor Shikhar Complex, Parle Point, Surat 395007, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 1041, 0, 101, 'f', 'f'),
(220, 'Kairali Ayurvedic Centre Pvt. Ltd.', 'Founded in 1989, \"Kairali Ayurvedic Center\" has over 25 years of experience. Using the ancient science of Ayurveda as its only means Kairali established itself as the pioneer in Ayurvedic treatment centres by setting its first centre at New Delhi and never looked back. Now with 35 locations all over the world Kairali is one of the fastest growing Ayurvedic brand', NULL, 'Andheria Modh D - 120 | Near Nature Bazar, New Delhi 110074, India', NULL, NULL, '+91 11 6566 4447', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'Andheria Modh D - 120 | Near Nature Bazar, New Delhi 110074, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(221, 'Awaken Inner Buddha Yoga & Meditation', 'Awaken Inner Buddha - is a Yoga / Meditation / Healing organization that teaches and provides therapy sessions / massage in more than 30 countries with head office in New Delhi, India. In New Delhi we offer the following 1) Yoga Meditation Class ( 2.5 Hours ) 2) Half Day Yoga Meditation Workshop ( 5.5 Hours ) 3) Reiki Therapy 4) Transcendental Therapy 5) Healing Massage Therapy 6) Personalized Life Transformation programs - using Yoga Meditation Transcendental Therapy. All sessions yoga class/workshops or therapies need to be pre-scheduled. No walks in allowed. All therapies are conducted at the comfort of your hotel or home , since we expect you to Sleep off for atleast 30 minutes after therapy instead of rushing into Delhi traffic. Yoga Classes happen in the green of Lodhi Garden in nature, with exception of when the weather does not allow. At Awaken Inner Buddha Yoga - the class is a deep experience of Patanjalis classical approach of physical yoga leading into Breath Yoga ending up into a deep meditation experience. It is not an ordinary yoga class where you step into to stretch your body. It is a holistic experience and all our classes are tailored to serve micro groups ( upto 6 people ) so prior appointment is mandatory. In our classes the art of meditation or working directly with the mind is given supreme importance. All physical or breath practices, is to help you go into direct observance of your own mind and release the stress and negative cycles. With a rare combination of classical yoga practices combined with buddhist meditation - there are very few teachers in India/world who can lead you into so well into your own mind.', NULL, '| 2/24, Second Floor, Backside Flat, Jangpura, New Delhi 110014, India', NULL, NULL, '+91 98910 02141', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, '| 2/24, Second Floor, Backside Flat, Jangpura, New Delhi 110014, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 706, 10, 101, 'f', 'f'),
(222, 'Quan Spa', 'The 10,000 sq. ft. Quan Spa is designed to soothe the weariest of travelers and is a retreat from the daily hustle-bustle of life. The Spa is dedicated to restoring balance and harmonizing energy by masterfully blending wellness principles of the East and the West. With the highest standards of service, the Quan Spa is an internationally recognized oasis offering an enriching experience designed t', NULL, 'Asset Area 4, Hospitality District, Delhi Aerocity | JW Marriott New Delhi Aerocity, New Delhi 11003', NULL, NULL, '+(91)45212195', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'Asset Area 4, Hospitality District, Delhi Aerocity | JW Marriott New Delhi Aerocity, New Delhi 110037, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(223, 'Auraveda Wellness Centre', 'AURAVEDA WELLNESS- Auraveda is a center for Alternative & Complimentary medicine, located in Kalkaji, New Delhi (We are not a Normal/Luxurious Spa- You can avail only Ayurvedic-Wellness-Curative therapies here - No Thai - Shiatsu - Hot stone massages are available) and is devoted to our age–old Indian system of medicine, Ayurveda, with holistic approach of health care. The Auraveda wellness group provides genuine alternate medical health care in the field of Ayurveda; both in preventive and curative aspects to address various health problems caused by modern lifestyles. We offer a variety of treatment programs which includes rejuvenation therapies, various detoxification and clinical treatments along with beauty care packages in harmony with the principles of Ayurveda.', NULL, '19 / 2 Epdp Road | Adjacent to B Block Gurudwara, Opp to CR Park, Main Rd, New Delhi 110019, India', NULL, NULL, '+91 85270 08995', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, '19 / 2 Epdp Road | Adjacent to B Block Gurudwara, Opp to CR Park, Main Rd, New Delhi 110019, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 706, 10, 101, 'f', 'f'),
(224, 'Sawadhee Traditional Thai Spa', 'Consecutive winners of Geospa AsiaSpa awards for last four years. For 2015, Sawadhee Traditional Thai Spa won the Geospa AsiaSpa Most Luxurious Spa (Day) Award 2015 and for 2014 the Best Spa Interiors Award. (AsiaSpa is a leading and the most prestigious magazine for the spa industry, which organises the AsiaSpa Awards annually to acknowledge the best spas in the country.) -- The Sawadhee Traditional Thai Spa in Vasant Kunj is spread across more than 5000 sq. ft of luxurious space. Here is a Boutique Spa where the warmth of the décor sets the mood for your journey towards physical & spiritual wellbeing. Borrowing its name from the traditional Thai greeting, this magical escape will boost your well-being to a whole new level. A soft, serene mood sets in from the moment you step in and are welcomed by a pleasing staff that will be happy to help you make a selection. You can indulge in incredible treatments that will not only smell heavenly but will also work on those trouble spots that', NULL, 'Plot No.3 | Pocket C-9, Local Shopping Center, Vasant Kunj, New Delhi 110041, India', NULL, NULL, '+91 11 4057 6341', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'Plot No.3 | Pocket C-9, Local Shopping Center, Vasant Kunj, New Delhi 110041, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(225, 'NeoVeda Spa', 'Based on the concept of New Ayurveda, our Spa showcases the modern translation of ancient Indian knowledge of life and well-being. It is a heaven of peace and tranquility set in a contemporary ambience, for those who wish to relax, restore and rejuvenate body, mind and spirit. An exclusive paradise filled with exotic aromas, essential oils, spice and floral fragrances, designed to enhance and optimize the total “mind-body experience” and peel away the layers of daily stress. Plush 7000 sq. ft. area is home to a state-of-the-art gym and a spa offering Indian as well as international spa practices. Offering an unparalleled personal care concept, Spa incorporates an array of classic and modern treatments, massages, scrubs, wraps, facials, baths, foot and hand care, slimming, toning and firming techniques.', NULL, 'Bangla Sahib Road, Near Connaught Place | The Metropolitan Hotel & Spa, New Delhi 110001, India', NULL, NULL, '+91 11 4250 0200', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'Bangla Sahib Road, Near Connaught Place | The Metropolitan Hotel & Spa, New Delhi 110001, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(226, 'CHI, The Spa', 'After making it’s mark around the world in more than 44 countries, CHI, The Spa - award winning, signature spa brand for Shangri-La Hotels and Resorts, is now pampering its patrons in New Delhi. In traditional Chinese philosophy, ‘chi’ or ‘qi’ is the universal force that governs well-being and personal vitality. It is an oasis where holistic treatments based on traditional techniques are shared by Asian cultures. Skilled therapists and authentic treatments will ensure you find tranquillity and the true essence of Chi. The interiors take inspiration from the traditions that lie in these ancient rituals through the use of unique accents reflecting local architecture and materials, as well as the subtle use of Asian art and accessories. Warm tones, wooden accents and dim lighting create an ideal ambience for revitalizing one’s body and spirit. The Spa boasts of facilities such as steam and a sauna room, an indoor and outdoor Jacuzzi, gymnasium, fitness studio and outdoor swimming pool. The services, along with a luxurious product range, have been created based on the Chinese philosophy of the five elements, in which metal, water, wood, fire and earth are in balance with the positive Yang and negative Yin energy within the body. The restorative powers of natural oils and herbs combined with Asian healing philosophies are at the center of every ritual. Chi offers classic journeys such as the Shangri-La Journey rendered in a luxurious yet serene setting, designed to pamper guests and restore balance and harmony to the mind and body. It also offers signature journeys based on the “Sense of Place” such as the Taste of India Retreat and the Kalp Shringar that use indigenous ingredients and techniques drawn from the ancient healing traditions found in the rich and mystical history of India. Moreover, brides-to-be can also opt for a special series of beauty rituals that finish off with the ultimate experience of a Rani Padmawati milk bath to obtain a hydrated and glowing skin for the big day. Patrons can also avail regular salon services like manicure, pedicure, nail services, waxing and hair services. A wide range of therapies and services ranging from Ayurvedic to contemporary international treatments have been carefully designed to provide a luxurious and relaxing spa experience. Chi, The Spa is committed to providing the best invigorating, revitalizing and therapeutic services. It a sanctuary of tranquility where one can step in to escape from the daily hectic routine and rejuvenate one’s mind, body and soul.', NULL, '19 Ashoka Road | Shangri La\'s - Eros Hotel, Connaught Place, New Delhi 110001, India', NULL, NULL, '+91 11 4119 1220', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, '19 Ashoka Road | Shangri La\'s - Eros Hotel, Connaught Place, New Delhi 110001, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(227, 'Gold Leaf Spa', 'Winner of Best Spa Award! ISO 9000-2015 Certified SPA. Only 5 minutes from the Delhi Airport, 2 minutes walk from the \'Aerocity\' Station of the Airport Metro Train. 500 meters from Holiday Inn. \"Gold Leaf Spa\" is an Indo-Thai Joint Venture. Body Massages, Body Scrubs And Spa Facials. In your Spa, all Therapy Rooms and Beds are \"Vastu\" Oriented to ensure proper opening of your Chakraa\'s or energy centers in your body. We welcome you to visit us to experience Thai hospitality at its best. We have a beautiful smile, a friendly service, extending warmth to all who visit us. Our world-class therapies and proprietary balms will sooth your body and soul. Our Master therapists will ensure that you leave us fully recharged. All our massage oils and balms, Scrubs, Elixirs and Hydrosols are made in-house from 100% natural ingredients and herbs and flowers. You deserve to feel this good. We Care!', NULL, 'Aerocity A2/269 | Mahipalpur Extension, New Delhi 110037, India', NULL, NULL, '+91 99990 22974', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'Aerocity A2/269 | Mahipalpur Extension, New Delhi 110037, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(228, 'The Four Fountains Spa', 'The Four Fountains Spa is India\'s largest chain of affordable health spas. We offer spa therapies for de-stressing, detoxification, immunity and beauty for men and women. Therapies offered include over 20 massages, body polishes, body wraps and facials.', NULL, '2\'nd Floor E - 18 Ndse Market | Behind Kotak Mahindra Bank, Next to Ritu Kumar, New Delhi 110049, In', NULL, NULL, '+91 11 4165 0016', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, '2\'nd Floor E - 18 Ndse Market | Behind Kotak Mahindra Bank, Next to Ritu Kumar, New Delhi 110049, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(229, 'Alaya Spa + Salon', 'An organic day spa and salon with a traditional tibetan theme,right in the heart of the city. specialised in different traditional spa therapies from all the best spa destinations around the globe. Introducing alaya signature therapy \"traditional tibetan kunye\" a must try for deep relaxation.Salon services includes,hair spa,color,facials,hails,styling\'s,makeups etc', NULL, '9 Community Centre | PVR Anupam Complex, Entry Opportunity Axis Bank, Saket, New Delhi 110017, India', NULL, NULL, '+91 99992 43888', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, '9 Community Centre | PVR Anupam Complex, Entry Opportunity Axis Bank, Saket, New Delhi 110017, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 706, 10, 101, 'f', 'f'),
(230, 'Aheli Spa, Roseate House', 'The Sanskrit derivation of “Aheli” is “pure”, while in Hebrew, it embodies the feeling of purity, grace and elegance. Aheli spa at Roseate House offers an atmosphere of calm, serenity and peace. Experience eternal bliss as you enter its doors on the top most floor of the hotel. Aheli is divided into a relaxing lounge with a soothing pebbled water body in the centre, four spacious therapy rooms including a couple therapy room and a beauty salon. Each therapy room has its own bathroom with rain shower and steam option, while the couple therapy room houses a swanky Jacuzzi. In addition to rain showers in each bathroom and digital lockers, the ladies and men’s wet area have a steam room and a relaxing lounge like sauna overlooking the city. With an emphasis on pampering and wellness, the therapies are inspired from the best health and beauty practices sourced from age-old treatments blended with modern techniques to pamper and revitalise guests.', NULL, 'Asset 10 | Roseate House New Delhi, Hospitality District, New Delhi 110002, India', NULL, NULL, '+91 11 7155 8838', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'Asset 10 | Roseate House New Delhi, Hospitality District, New Delhi 110002, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
(231, 'Aura Heritage Spa', 'Step into a space where tranquility encompasses you. A place where the boundaries of reality and fantasy blend in harmony. Wellness surrounds you, time stands still, and a sense of deep relaxation washes over. Enveloped in a haven of serenity, you quickly forget that you are in the heart of a bustling city. The spa\'s tranquil, meditative setting allows you to embark on a personalized journey towards relaxation.', NULL, 'E20 | E Block, New Delhi 110024, India', NULL, NULL, '+91 99100 15140', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'E20 | E Block, New Delhi 110024, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 0, 0, 6, 706, 10, 101, 'f', 'f'),
(232, 'Blue Terra Spa GK2( till Amit)', 'Blue Terra Spa in GK2 is located in the main M Block market of Greater Kailash Part 2. At Blue Terra Spa GK2 you can experience Ayurvedic and International therapies in hygienic ambience, delivered by trained professional therapists.', NULL, '1st Floor M 54 | M Block Market, Greater Kailash Part 2, New Delhi 110048, India', NULL, NULL, '+91 11 4053 5500', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, '1st Floor M 54 | M Block Market, Greater Kailash Part 2, New Delhi 110048, India', 'b-2.jpg', NULL, NULL, NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
