(236, 'Keiken Spa', 'Escape to the luxuries of Keiken Spa. Inspire your body and soul towards Indulgence and Renewal!Keiken Spa is a sanctuary that transports you to a different world with its multicultural treatments and service.The Ambience at Keiken encourages indulgence, personalized via uniquely themed rooms with a special foot-cleansing ritual by your skilled masseuse. This is followed by a body scrub that is relaxing and rejuvenating. Once you are transported through the Keiken Journey we promise to Elevate your Senses with our highly reputed Body Massages.', NULL, 'M - 68, New Delhi 110048, India', NULL, NULL, '+91 11 2924 3383', NULL, 1, '2018-06-25 01:12:57', NULL, NULL, NULL, 'M - 68, New Delhi 110048, India', 'b-2.jpg', 'Keiken Spa in Greater Kailash 1, Delhi', 'Keiken Spa in Greater Kailash 1, Delhi', NULL, NULL, 2, 15, 6, 706, 10, 101, 'f', 'f'),
