(276, 'Spa by JW', 'Spa by JW is operational 24 hours in order to cater to the business travellers. The 12 minutes, 25 minutes and 40 minutes dry massages done on the unique Express pods for the back, neck, shoulder and hands are a quick fix to rejuvenate the body and mind.• Spa By JW comprises of 7 treatment rooms including ayurveda rooms and couples bathing jacuzzi, and 2 express treatment. *Terms and conditions apply, prior reservations are required.', NULL, 'IA Project Road | JW Marriott Mumbai Sahar, Chhatrapati Shivaji International Airport, Andheri, Mumb', NULL, NULL, '+91 22 2853 8791', NULL, 1, '2018-06-25 12:46:48', NULL, NULL, NULL, 'IA Project Road | JW Marriott Mumbai Sahar, Chhatrapati Shivaji International Airport, Andheri, Mumbai 400099, India', 'b-2.jpg', 'Spa By Jw in Ashok Nagar, Bangalore', NULL, NULL, NULL, 2, 15, 6, 0, 17, 101, 'f', 'f'),
(277, 'Le Tranquille Spa', 'When in Bangalore, Spa at Le Tranquille, the best luxury day spa around town. Awarded, liked, visited by localites, visitors and tourists alike - it extends an unparalleled luxury spa experience in the garden city of India. Voted India\'s Best Luxury Boutique Spa for 2016 and 2013 by the World Luxury Spa Awards and nested in Upper Palace Orchards area in Bangalore, this ocean of tranquility offers a luxury spa experience like none other in Bangalore. Whether you are visiting Bangalore or hopping by and have a luxury pampering spa treatment on your mind, this is the place to be.', NULL, 'Sankey Rd | Level 1, JM Plaza, Bengaluru 560080, India', 'Mini', 'mini@virgowellness.com', '91 80 2360 9988', NULL, 1, '2018-06-25 12:46:49', NULL, NULL, NULL, 'Sankey Rd | Level 1, JM Plaza, Bengaluru 560080, India', 'b-2.jpg', 'Le Tranquille', NULL, NULL, NULL, 2, 15, 6, 0, 17, 101, 'f', 'f'),
(278, 'Aroma Home Spa', 'Our Spa is where you can really feel at home. The cozy décor will put you at ease instantly. This is also a place where good energy and positive vibes are in abundance. We strive each day to create a tranquil spa experience that indulges the senses with luxurious natural products for all our spa services. Our therapists are well trained to provide expert services with care that provides lasting effects on body and mind.You can now gift your loved ones a special spa gift with the convenience of our online gift voucher/certificate purchase option. Simply choose the package of your choice, make your payment online and receive the gift certificate directly to your email.', NULL, 'ITPL Main Road | 3rd Floor, Sai Kamala Trinity , Opposite Cosmos Mall, Brookefields, Bengaluru 56003', 'Nitin Mehta', NULL, '91 96861 30601', NULL, 1, '2018-06-25 12:46:49', NULL, NULL, NULL, 'ITPL Main Road | 3rd Floor, Sai Kamala Trinity , Opposite Cosmos Mall, Brookefields, Bengaluru 560037, India', 'b-2.jpg', 'Aroma Home Spa Services', NULL, NULL, NULL, 2, 15, 6, 0, 17, 101, 'f', 'f'),
(279, 'SPA.ce the Spa', 'SPA.ce the Spa welcomes you to one of Bangalore’s best spas. We’ve been offering exceptional spa packages for men and women in the city since 2005, and we promise to rejuvenate your body, mind, and soul through our range of therapeutic treatments. SPA.ce invites you to a world of blissful indulgence that will refresh your body and renew your soul. We are among the few spas in Bangalore that specialize in offering customized spa deals and spa packages for men, women, and couples. Whether you’re looking for a full body massage, body scrub & wrap or body polish, or other spa therapies, our skilled team of masseurs are sure to breathe new life into you, so when you walk out, you’re ready to take on the world again!', NULL, 'Service Road | Domlur Indiranagar, Bengaluru 560038, India Indiranagar', NULL, NULL, '+91 80 4217 1051', NULL, 1, '2018-06-25 12:46:49', NULL, NULL, NULL, 'Service Road | Domlur Indiranagar, Bengaluru 560038, India Indiranagar', 'b-2.jpg', 'SPA ce The Spa', NULL, NULL, NULL, 0, 0, 6, 0, 17, 101, 'f', 'f'),
