(393, 'BamboooTree All Day Spaa', 'To take a respite from the daily grind and to wash off the workday tensions that besiege us, and to store up as much as we can of the pleasant vibes and warm memories until the next escapade, that\'s what the Bambooo Tree All Day Spaa, started in 2009 in Mumbai is all about. With its women-oriented spa treatments catering from a delightful soy candle, to an Medium to intense pressure massage using a warm Bamboo. Till the sensitive PMS pains and mood swings, the Khar-based Bambooo Tree All Day Spa is a perfect destination for all those stressed out 9-5 workoholic women longing for some pampering. The spa re-launched itself with its signature treatments at a plush new place at Khar, with the perfect ambience to suit its dedicated clientele. Be it the famous Dr. Fish Therapy, or the unique one-of-its-kind Bamboo massage or the soothing Candle massage â€\" everything you always loved is all here as before! The spa offers a host of immaculate relaxation and beautifying therapies that will pamper your every mood and lets you unwind. The spa also offers an array of indulgent treatments including Swedish massage, Deep Tissue Massage, Hot Stone Therapy (For Spondylitis and Stiff Back), Lymphatic drainage massage & other body treatments, Marine Facial, different kinds of Manicures and Pedicures, Reflexology & Oriental Scalp Massage and PMS Massage (Pre menstrual syndrome) to renew, replenish, and relax you completely in a space where you can find your own inner tranquility.', NULL, 'Dr. Ambedkar Road | 1st Floor Shivanjali Bldg, Behind Shivanjali Apts, Mumbai 400052, India', NULL, NULL, '+91 99879 56649', NULL, 1, '2018-06-25 01:00:47', NULL, NULL, NULL, 'Dr. Ambedkar Road | 1st Floor Shivanjali Bldg, Behind Shivanjali Apts, Mumbai 400052, India', 'b-2.jpg', 'Bambooo Tree All Day Spaa in Khar West, Mumbai', 'Bambooo Tree All Day Spaa in Khar West, Mumbai', NULL, NULL, 8, 21, 6, 2707, 0, 101, 'f', 'f'),
