(397, 'Dhanwantri Kerala Ayurved', 'For over a decade Dhanwantri Kerala Ayurved ( A Unit Of Rejuv Healthcare Services Pvt. Ltd.) has been one of the oldest and most respected in Mumbai by the people who have visited us, as it has helped them save their precious time and money by providing them with authentic ayurvedic therapies as they are performed in Kerala. From a modest beginning in 1999 the health centre is now an extensive facility providing from the simple to the most complex Ayurveda & Spa therapies. All our guests quickly learn to listen to their bodies - and they feel the tension and stress dissolve with the warm oil and the rhythmic strokes of the therapists. An increasing number of guests come for shoulder pain, back ache - sciatica, insomnia, skin disorders , sinusitis, psoriasis , allergies, arthritis, to name a few. At DKA, the emphasis is on a holistic approach to treatments combined with a range of products to enable our customers to continue to gain therapeutic benefits once back into their normal daily routine. All ayurvedic medicines & oils used for various treatments are made by the renowned family of Ashtavaidya (physicians who have mastered all the eight Branches of Ayurveda) because their products have the ability to soothe, relax and rejuvenate, while producing highly visible results for all skin types. Facilities At Dhanwantri Includes : Rejuvenating Spa therapies (Body Treatments, Stress Management, Beauty Treatments, Diet & Nutrition etc) Corporate Staff Welfare Programmes, Certified Spa Courses to individuals / health professionalsOur Services have been availed by Hotel Renaissance, Hotel Retreat, Hotel Ramada, Hotel Intercontinental The Grand, Ras Resorts, Classique Club to name a few.', NULL, 'Cardinal Gracious Road | Shubham Centre, B Wing, Ground Floor, Mumbai 400099, India', NULL, NULL, '+91 98208 07915', NULL, 1, '2018-06-25 01:00:47', NULL, NULL, NULL, 'Cardinal Gracious Road | Shubham Centre, B Wing, Ground Floor, Mumbai 400099, 