(432, 'Myrah', 'Thus has come into being \"Myrah\" a luxurious destination day spa in mumbai nestled cosily in the lazy suburbs of the very upmarket Juhu.A place where one enters and is not just treated like royalty but one becomes royalty. One is immediately transported into a space of relaxing beautiful energy and divine calm. Myrah is not just another spa but a haven where we cater to the outer wellbeing of an individual which is as important as a calm inner state.The zen like interiors of this spa in mumbai along with brocade backdrops, crystal chandeliers, ornate gold mirrors of Myrah, create a delicious balance of the subtle with the opulent. An old world charm mixed with the contemporary to make it one of the best spas in Mumbai.', NULL, '11 Palm Spring Society | Behind Juhu Shoppers Stop, JVPD Scheme, Mumbai 400049, India', 'Nisha Javeri', 'wellness@myrah.com', '+91 98200 40002', NULL, 1, '2018-06-25 01:00:47', NULL, NULL, NULL, '11 Palm Spring Society | Behind Juhu Shoppers Stop, JVPD Scheme, Mumbai 400049, India', 'b-2.jpg', 'Myrah in JVPD Scheme-Juhu, Mumbai', 'Myrah in JVPD Scheme-Juhu, Mumbai', NULL, NULL, 0, 0, 6, 2707, 0, 101, 'f', 'f'),
