(452, 'Aline’s Beauty Care', 'A spa and salon combination in Candolim Goa India. We offer a wide range of treatments from hair to face to body / beauty to relaxation to rejuvenation. We are a one stop for all that you are looking for to have a better look and a better feel. We ensure that we provide you value at all times by having trained professionals at all levels in the organisation. We invest quite a bit of time in implementing quality systems and processes on a continuous basis which helps us stay ahead in this highly competitive and dynamic field of hospitality. We try to give a personal touch to whatever we do to the best of our ability and we take pride when our patrons feel and appreciate the same through reviews and feedbacks. We believe in delivering value to our customers / patrons and we will continuously strive to reach levels of excellence in each and every area of our operation. We will not call ourselves the best but we would love to hear that from our patrons. Wish you a great time with us.', NULL, 'Ground Floor, Sea Mist Building Near Fortune Hotel, Candolim, Bardez 403515, India', NULL, NULL, '+91 77740 50011', NULL, 1, '2018-06-25 01:02:32', NULL, NULL, NULL, 'Ground Floor, Sea Mist Building Near Fortune Hotel, Candolim, Bardez 403515, India', 'b-2.jpg', 'Aline\'s Beauty Care & Spa in Candolim, Goa', 'Aline\'s Beauty Care & Spa in Candolim, Goa', NULL, NULL, 2, 15, 6, 733, 11, 101, 'f', 'f'),
(453, 'Daddu\'s Healing Center', 'My Mission: Restoring and generating health and happiness through balance and alignment using the best of modern and traditional methods. My Background I grew up in Varanasi with a grandfather who was an Indian national wrestling champion. I spent everyday in his wrestling studio and I came to understand how to care for a body that is out of balance and alignment from simple over work or from a specific injury, and how to bring it back in balance. My Experience & Approach to Healing: Early in my career I then worked for several professional sports organisations including soccer, track and field athletes, swimming, and wrestling. Working with professional athletes gave me experience in massage and physiotherapy techniques to improve performance and wellbeing, as well as treat all kinds of wear and tear and injuries. You don\'t need to be an athlete to benefit from my massage. Whether you want to relax, improve your circulation, remove blockages or nerve issues, or release tension, my healing approach is to bring the body into balance and alignment through a combination of deep tissue and ayurvedic methods that have changed lives, so my clients say.', NULL, 'Patnem Beach, Canacona 403702, India', NULL, NULL, '+91 92845 28126', NULL, 1, '2018-06-25 01:02:32', NULL, NULL, NULL, 'Patnem Beach, Canacona 403702, India', 'b-2.jpg', 'Daddu\'s Healing Center in Canacona, Goa', 'Daddu\'s Healing Center in Canacona, Goa', NULL, NULL, 2, 0, 6, 733, 11, 101, 'f', 'f'),
