(458, 'Himalayan Therapeutic Studio', 'Ranjeet Mogu is a physio therapist with more than 20 years experience. He is a graduate in Classical and Ayurvedic Medicine. In his work with the body (massage and physiotherapy) he combines the ancient Ayurvedic approach to healing and a modern body-orientated way of removing emotional blockages. He studied this integrated healing technique at the unique Osho Community Centre in Pune. Ranjeet is also a Reiki Master, part of the Dr Mikao Usui tradition; as well as a certified teacher of Hatha Yoga for practitioners and yoga teachers, affiliated with Yoga Alliance. Ranjeet works internationally in Austria, Germany, Russia, Kazakhstan and India.', NULL, 'Between Neptune Point and Ma-Rita | Palolem Beach, Palolem, Canacona 403702, India', 'Ranjeet', NULL, '+91 90494 29895', NULL, 1, '2018-06-25 01:02:32', NULL, NULL, NULL, 'Between Neptune Point and Ma-Rita | Palolem Beach, Palolem, Canacona 403702, India', 'b-2.jpg', 'Himalayan Therapeutic Studio in Palolem, Goa', 'Himalayan Therapeutic Studio in Palolem, Goa', NULL, NULL, 2, 15, 6, 733, 11, 101, 'f', 'f'),
