(460, 'Cyril Yoga Ayurveda Centre', 'Cyril yoga providing 99% practical challenging and dynamic family traditional yoga classes. (Hath & ashtanga yoga.) Taught by world-renowned yoga master Mr. Cyril yogi. Since 1993 in India and worldwide. Many generations was following and teaching yoga in his family. Students can feel at ease with a money-back guarantee when attending a 21-day workshop incorporating the recommended yoga diet and not being satisfied with the results. Drop-in class time: 8.30 to 10.30 (2 hour) Mon to Sunday (7 days) 18.00 to 19.30(90 min) Mon to Friday (5 days) Drop-in class - you should five minutes prior to class commencing. (Yoga mats are available to buy or rent) Cyril yoga workshop: ancient tradition of Cyril yoga system, fully focusing to purify your body, mind and soul in a natural way. 21 days program is starting from Monday to continuously 21 days everyday total you wanted to attend 36 class if you wanted to join this workshop booking is necessary book from our web.', NULL, 'Calangute - Anjuna Road | Behind Navratna Udupi, Opp. Royal Heritage Resort, Calangute 403516, India', 'Cyril Yogi', 'cyrilyoga@gmail.com', '+91 94238 89377', NULL, 1, '2018-06-25 01:02:32', NULL, NULL, NULL, 'Calangute - Anjuna Road | Behind Navratna Udupi, Opp. Royal Heritage Resort, Calangute 403516, India', 'b-2.jpg', 'Cyril Yoga Ayurveda Centre, Goa', 'Cyril Yoga Ayurveda Centre, Goa', NULL, NULL, 2, 15, 6, 733, 11, 101, 'f', 'f'),
