(468, 'Ashok Yoga', 'Ashtanaga vinyasa + Hatha yoga flow +Kundalini yoga everyday@09:30hrs Ashok\'s energy, the way he guides your breath and instantly creates a focused atmosphere for a beautiful practice. Ashok creates something magical to explore your asana practice. Go to his class. Grace,Goa I loved the location but the teacher is the most important part; Ashok was a great teacher and I have been inspired to continue practising yoga everyday. Thank you!I Lisa Kater West Kilbride, Scotland Adapted the practice to the individual, hands on, great adjustments and advice on how to improve, friendly and supportive, great energy, best classes we did in varkala Emma And Rory London, UK Wonderful Vinyasa Yoga Class practised in breathtaking location between Pallolem and Columb beach! Although I was new to vinyasa, I have practised yoga since 2006 and I can definitely say that Ashok is one of the best teachers I have met, and beautiful, calming soul. We practised with him every day. Monika & Tom London', NULL, 'Neptune Point Beach Resort | South end of pallolem beach or near column beach, Palolem, Canacona 403', NULL, NULL, '+91 97406 41209', NULL, 1, '2018-06-25 01:02:32', NULL, NULL, NULL, 'Neptune Point Beach Resort | South end of pallolem beach or near column beach, Palolem, Canacona 403702, India', 'b-2.jpg', 'Ashok Yoga in Palolem, Goa', 'Ashok Yoga in Palolem, Goa', NULL, NULL, 2, 0, 6, 733, 11, 101, 'f', 'f'),
